import { call, put } from 'redux-saga/effects'
import * as decksActions from '../decks/decks-actions';

function* initApp() {
  yield put(decksActions.fetchDecksRequest());
}

export function* AppSaga() {
  console.log('hola')
  yield call(initApp);
}
